import React from 'react'
import MainProject from "./pages/MainProjectPage/ListProduct";
import Construction from "./pages/ConstructionPage/Construction";
import Design from "./pages/DesignPage/Design";
import SampleDesign from "./pages/SampleDesignPage/SampleDesign";
import Contact from "./pages/ContactPage/Contact";
import CreateProduct from "./pages/CreateProductPage/CreateProduct";

const routes = [
    {
        path: '/',
        exact: true,
        main: () => <ProductList/>
    },
    {
        path: '/design',
        exact: true,
        main: () => <Design/>
    },
    {
        path: '/construction',
        exact: true,
        main: () => <Construction/>
    },
    {
        path: '/sample-design',
        exact: true,
        main: () => <SampleDesign/>
    },
    {
        path: '/contact',
        exact: true,
        main: () => <Contact/>
    },
    {
        path: '/create-product',
        exact: true,
        main: () => <CreateProduct/>
    }
];

export default routes;
